class Solution(object):
    def minimumFinishTime(self, tires, changeTime, numLaps):
        """
        :type tires: List[List[int]]
        :type changeTime: int
        :type numLaps: int
        :rtype: int
        """
        def getTime(laps, tire):
            return tire[0] * (pow(tire[1], laps) - 1) / (tire[1] - 1)

        tires = sorted(tires, key=lambda x : x[0])
        new_tires = list()
        for idx, tire in enumerate(tires):
            if idx > 0:
                if tires[idx][1] <= tires[idx-1][1]:
                    new_tires.append(tire)
            else:
                new_tires.append(tire)

        MAX_LAP = 20
        min_times = [float("inf")] * (min(MAX_LAP, numLaps) + 1)
        min_times[0] = 0
        for x in range(1, min(MAX_LAP, numLaps) + 1):
            for new_tire in new_tires:
                min_times[x] = min(min_times[x], getTime(x, new_tire))

        dp = [float("inf")] * (numLaps + 1)
        dp[0] = 0
        for x in range(1, numLaps + 1):
            for y in range(1, min(x, MAX_LAP) + 1):
                if x == y:
                    dp[x] = min(dp[x], dp[x - y] + min_times[y])
                else:
                    dp[x] = min(dp[x], dp[x - y] + changeTime + min_times[y])
        return int(dp[numLaps])


